import React, { Component } from 'react'
import PropTypes from 'prop-types';
class DashboardLayout extends Component {
  constructor(props) {
    super(props)
    this.state = {
      grid: [
        [{ value: 1 }, { value: 3 }],
        [{ value: [1, 2, 3, 4, 5] }, { value: 4 }]
      ]
    }
  }

  render() {
    return (
      <div>
        <p>DASHBOARDLAYOUT</p>
      </div>
    )
  }
}

DashboardLayout.propTypes = {

}

export default DashboardLayout
